import React from 'react';

class Home extends React.Component {
    handleClick() {
        console.log('this is:', this);
    }

    render(){
        // This syntax ensures `this` is bound within handleClick
        return (
            <button onClick={() => this.handleClick()}>
                Click me
            </button>
        );
    }
}

export default Home;
